import React,{useState} from 'react';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGoogle } from '@fortawesome/free-brands-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faFacebook } from '@fortawesome/free-brands-svg-icons';
import './TestLogin.js';
import './LoginSignup.css'; // แก้ไขชื่อไฟล์ CSS
function Anchor({ href, children }) {
    return <a href={href}>{children}</a>;
}

const LoginSignup=()=> {
    const [formData, setFormData] = useState({
        username:'',
        email:'',
        password:'',
        c_password:'',
        date_of_birth:'',
        gender:'',
    })
    const handleChange = (element)=>{
        const {name_data,value}= element.target
        setFormData(prevState=>({
            ...prevState,
            [name_data]: value
        }))
    }
    const handleSubmit = async(element)=>{
        element.preventDefault()
        try{
            const response = await axios.post('/register/api/createUser',formData)
            console.log("user registered Success --->",response.data)
        }catch(err){
            console.error(err.message)
        }
    }
    return (
        <div className="Container" id='Container'>
            <div className='Form-container sign-up'>
                <form onSubmit={handleSubmit}>
                    <h1>Create Account</h1>
                    <div className="Social-icons">
                        <FontAwesomeIcon icon={faGoogle} className="icon"/>
                        <FontAwesomeIcon icon={faGithub} className="icon"/>
                        <FontAwesomeIcon icon={faFacebook} className="icon"/>
                    </div>
                    <span>or use your email for registered</span>
                    <input type="text" name="username" placeholder="Username" value={formData.username} onChange={handleChange} />
                    <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange}/>
                    <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange}/>
                    <input type="password" name="c_password" placeholder="Confirm Password" />
                    <input type="text" name='name' placeholder='First name' value={formData.name} onChange={handleChange}/>
                    <input type="text" name='lastname' placeholder="Last name" value={formData.lastname} onChange={handleChange}/>
                    <input type="Date" name="Date_Of_Birth" value={formData.date_of_birth} onChange={handleChange}/>
                    <select name="gender" value={formData.gender} onChange={handleChange}>
                        <option value="">Select Gender</option>
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                        <option value="LGBTQ+">LGBTQ+</option>
                    </select>
                    {/*<input type="text" name="Address" placeholder="Your address" />
                    <input type="text" name="Phone_Number" placeholder="Phone Number" />
                    <input type="text" name="Additional_Information" placeholder="More Information" />*/}
                    <button type='submit'>Sign up</button>
                </form>
            </div>
            <div className='Form-container sign-in'>
                <form>
                    <h1>Sign In</h1>
                    <div className="Social-icons">
                        <FontAwesomeIcon icon={faGoogle} className="icon"/>
                        <FontAwesomeIcon icon={faGithub} className="icon"/>
                        <FontAwesomeIcon icon={faFacebook} className="icon"/>
                    </div>
                    <span>or use your email password for sign in</span>
                    <input type="email" name="email" placeholder="Email" />
                    <input type="password" name="Password" placeholder="Password" />
                    <Anchor href="#">Forgot Your Password ?</Anchor>
                    <button>Sign In</button>
                </form>
            </div>
            <div className="Toggle-container">
                <div className="Toggle">
                    <div className="Toggle-panel Toggle-left">
                        <h1>Welcome Back!</h1>
                        <p>Enter your personal details to use all of site features</p>
                        <button className="hidden" id='Login'>Sign In</button>
                    </div>
                    <div className="Toggle-panel Toggle-right">
                        <h1>Hello Everyone!</h1>
                        <p>Registered with your personal details to use all of site features</p>
                        <button className="hidden" id='Register'>Sign Up</button>
                    </div>
                </div>
            </div>
            <script async src="TestLogin.js"></script>
        </div>
    );
}

export default LoginSignup;
